description:
Total Film magazine features news, reviews and articles on all current and future video, film, book, soundtrack and multimedia releases. Big reviews on all the latest Hollywood and British films as well as some from further afield. Interesting interviews as well with some big names from the big screen.

Total Film - UK April 2014
Book Language: English 
Pages: 148
